import { WPCEdit } from 'wpcedit';

onmessage = function(event) {
    const index = event.data;
    WPCEdit.fullFrameImage.index = index;
    const plane = WPCEdit.fullFrameImage.plane;
    self.postMessage({msg: 'plane', plane});
  }
